"""Minimum Değer : Aykırı değerler hariç en düşük değer (sol ucun sonunda gösterilir).

İlk çeyrek (%25) : Skorların yüzde yirmi beşlik dilimine gelen kısmını gösterir.

Medyan : Medyan, verilerin orta noktasını işaretler ve kutuyu iki bölüme bölen çizgiyle gösterilir.

Üçüncü çeyrek (%75) : Skorların yüzde yetmiş beşlik dilimine gelen kısmını gösterir. Dolayısıyla, verilerin% 25’i bu değerin üzerindedir.

Maksimum değer : Aykırı değerler hariç en yüksek değeri gösterir
"""

sbn.boxplot(x = df.price, color = 'blue')
plt.show()

plt.figure(figsize=(7,5))
sbn.distplot(df["price"])

"""**scatterplot** """

sbn.scatterplot(x="mileage",y="price",data=df)

"""grafik analizi: kullanım miktarı arttıkça fiyatında doğal bir şekilde düşmesini bekleriz."""

sbn.scatterplot(x="year",y="price",data=df)

"""# Fiyat analizleri"""

df.sort_values("price",ascending=False).head(20) # En yüksek fiyatlı araçlarımız.

df.sort_values("price",ascending=True).head(20) # En düşük fiuyatlı araçlarımız.

"""**Burada genel şöyle bir yaklaşım yapmak istedim: Bir verinin %99 unu alarak o verinin yansıttığı genel tabloyu bozmadan işlemlerimize devam edebiliriz.Bende burada modelimin daha doğru çalışması için örneğimde az olan yüksek fiyatlı araçlardan, modelimi etkilememesi için yüzde birlik yüksek fiyatlı araçları çıkarttım.**"""

len(df)

len(df)*0.01

df = df.sort_values("price",ascending=False).iloc[131:]

"""**Veri temizliği :** Burada gereksiz bir transmission değeri var eğer böyle regresyona sokarsam numeric bir değer olmadığı için hata verecekktir o yüzden burayıda kladırıyorum."""

df = df.drop("transmission",axis=1)

"""# Modelimizi Oluşturalım"""

y = df["price"].values
x = df.drop("price",axis=1).values

x

y

from sklearn.model_selection import train_test_split #eğiteceğimiz diziye ve test edeceğimiz diziye bölme işlemi

x_train, x_test, y_train, y_test = train_test_split(x, y, test_size=0.3, random_state=10)

len(x_train)

len(x_test)

"""**scaling :** boyutunu büyütek veya küçültmek
nöronlara vereceğimiz versisetini küçük bir hale getirmek istiyoruz ki yapacağımız işlemler daha kolay olsun hemde hızlı bir şekilde bu süreci tamamlayabilelim.

sıfır ile bir arasındaki rakamlara yuvarlama işlemi yani normalizasyon yapıyoruz.
"""

from sklearn.preprocessing import MinMaxScaler

scaler = MinMaxScaler()

x_train = scaler.fit_transform(x_train)

x_test = scaler.transform(x_test)

x_train

x_train.shape

"""genel tanıya göre 5 tane özelliğimiz olduğundan beş katmandan başlamak daha doğru olabilir."""

from tensorflow.keras.models import Sequential # modeli oluşturuyoruz
from tensorflow.keras.layers import Dense      # modelin içindeki katmanları oluşturuyoruz

model = Sequential()

model.add(Dense(12,activation="relu"))#en güzel sonucu ben 12 nöronda elde ettim.
model.add(Dense(12,activation="relu"))
model.add(Dense(12,activation="relu"))
model.add(Dense(12,activation="relu"))



model.add(Dense(1))#çıkış katmanımız.

model.compile(optimizer="adam",loss="mse")

#modeli eğitme
model.fit(x=x_train,y=y_train,validation_data=(x_test,y_test),batch_size =250 ,epochs=300)#validasyon datamızı direk burada verdim.

kayipVerisi = pd.DataFrame(model.history.history)

"""**normal kaybımız ve doğrulama kaybımız**"""

kayipVerisi.head()

kayipVerisi.plot()#epochs fazla verilirse overfitting olabilir o yüzden fazla verilmemeli.
plt.savefig(fname="kayipVerisi.png",facecolor="white")

from sklearn.metrics import mean_squared_error,mean_absolute_error

tahminDizisi = model.predict(x_test)

tahminDizisi

mean_absolute_error(y_test,tahminDizisi)

